description:
I saw Playa Fly's collection on here uploaded by Nikeagogo so big up to them, but it was missing his first underground album as Lil' Fly which was released in 1994 I believe. This was produced by DJ Paul and strictly on cassette. Feel free to share and add to your own torrents as I'm not sure how long i'll have this up. I really wish someone would add more underground hiphop collections on here!
